import React from 'react'
import TodoList from './todo/todo-list'
import TodoInput from './todo/todo-input'

function App() {

  let todos = [
    {title:'Learn Js', done:false, id:'alkdj'},
    {title:'Repeat react tutorial', done:true, id:'kdks'},
    {title:'Js documentation', done:false, id:'lakdi'},
  ]
  function addTodo(title){
    const a = {
      title,
      done:false,
      id: Date.now()
    }
    todos.push(a);
  }
  return (
    <div className="App">
      <TodoList props={todos}></TodoList>
      <TodoInput addTodo = {addTodo}></TodoInput>
    </div>
  );
}

export default App;
